import React, { Component } from "react";
import { Link } from "react-router-dom";
import { ReactComponent as Healthlogo } from "../../healthcare.svg";
import styled from "styled-components";
import { ButtonContainer } from "../../Button";

export class Navbar extends Component {
  render() {
    return (
      // <NavWrapper className="navbar navbar-expand-sm navbar-dark">
      //   <Link
      //     to="/"
      //     className="navbar-brand"
      //     style={{ color: "white", textDecoration: "None" }}
      //   >
      //     <Healthlogo width="40px" height="35px" />
      //     CoronaTrace
      //   </Link>
      //   <form className="form-inline my-2 my-lg-0 ">
      //     <input
      //       className="form-control mr-sm-2"
      //       type="search"
      //       placeholder="Search"
      //       aria-label="searh"
      //     ></input>
      //     <button className="btn btn-primary" type="submit">
      //       Search
      //     </button>
      //   </form>
      //   <Link to="/login">
      //     <ButtonContainer>Log In</ButtonContainer>
      //   </Link>

      //   <Link to="/signin">
      //     <ButtonContainer primary>Sign In</ButtonContainer>
      //   </Link>

      // </NavWrapper>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <a class="navbar-brand" href="#">
          Navbar
        </a>
        <button
          class="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav mr-auto">
            <li class="nav-item active">
              <a class="nav-link" href="#">
                Home <span class="sr-only">(current)</span>
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">
                Link
              </a>
            </li>
            <li class="nav-item dropdown">
              <a
                class="nav-link dropdown-toggle"
                href="#"
                id="navbarDropdown"
                role="button"
                data-toggle="dropdown"
                aria-haspopup="true"
                aria-expanded="false"
              >
                Dropdown
              </a>
              <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                <a class="dropdown-item" href="#">
                  Action
                </a>
                <a class="dropdown-item" href="#">
                  Another action
                </a>
                <div class="dropdown-divider"></div>
                <a class="dropdown-item" href="#">
                  Something else here
                </a>
              </div>
            </li>
            <li class="nav-item">
              <a class="nav-link disabled" href="#">
                Disabled
              </a>
            </li>
          </ul>
          <form class="form-inline my-2 my-lg-0">
            <input
              class="form-control mr-sm-2"
              type="search"
              placeholder="Search"
              aria-label="Search"
            ></input>
            <button class="btn btn-outline-success my-2 my-sm-0" type="submit">
              Search
            </button>
          </form>
        </div>
      </nav>
    );
  }
}

const NavWrapper = styled.nav`
  background: rgba(23, 62, 221, 0.7);
  font-size: 2.5rem;
  padding: 5px;
  margin: 0;
`;
export default Navbar;
